import React, { FunctionComponent } from "react";
import styled from "styled-components";
import PropTypes from "prop-types";
import { IStyledProps, IThemeStateProps } from "../../../interfaces/types";

interface IYoutubeEmbed {
  id: string;
  themeState: IThemeStateProps;
}

const VideoContainer = styled.div`
  width: 100%;
  height: 100%;

  border: solid 5px ${(props: IStyledProps) => props.themeState.borderColor};
  border-radius: 15px;
`;

const IFrameContainer = styled.iframe`
  width: 100%;
  height: 100%;
`;

const YoutubeEmbed: FunctionComponent<IYoutubeEmbed> = ({ id, themeState }) => (
  <VideoContainer themeState={themeState}>
    <IFrameContainer
      src={`https://www.youtube.com/embed/${id}`}
      frameBorder="0"
      allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
      allowFullScreen
      title="Embedded youtube"
    />
  </VideoContainer>
);

YoutubeEmbed.propTypes = {
  id: PropTypes.string.isRequired,
};

export default YoutubeEmbed;
